function fadeInModal(modal) {
  $('body').css('overflow-y', 'hidden');

  $(modal).fadeIn(200);

  $('.modal__content').click(function (e) {
    e.stopPropagation();
  })

  $('.modal__close').click(function () {
    fadeOutModal();
  })

  $('.modal').click(function () {
    fadeOutModal();
  })

  function fadeOutModal() {
    $('.modal').fadeOut(200);
    $('body').css('overflow-y', 'scroll');
  }
}

